import Hero from '../components/Hero';
import NavBar from '../components/NavBar';



export default function Home(){
    return(
        <>
            <NavBar/>
            <h1>This is Home</h1>
            <Hero 
                cName="hero" 
                src="https://images.pexels.com/photos/1024967/pexels-photo-1024967.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" 
                title = "Your Journey Your Story"
                text = ""
                />

        </>
    );
}
